import React from 'react';
import './sidebar.css';
import './App.css'
import { Sidedata } from './sidedata';


export default function Sidebar() {
  return (
    <div className='Side'>

        <ul >
        {Sidedata.map((val,key) => {
            return(
                <li key={key} onClick={() => {window.location.pathname = val.link}}>
                    <div>{val.icon}</div>
                    <div>{val.title}</div>
                </li>
            )
        })}
        </ul>
    
    </div>
  )
}
